script: |
  super -f text -I q6174.spq | sort > q6174.out

inputs:
  - name: q6174.spq
    data: |
      SELECT + col1 AS col1 FROM tab1 (FORMAT parquet) WHERE + col2 * + + col1 * + + col0 NOT BETWEEN ( + col1 ) AND - 35;
  - name: tab1

outputs:
  - name: q6174.out
    data: |
      14
      47
      5
